import React from "react";
import styled from "styled-components";

const Section = styled.section`
  min-height: 100vh;
  width: 100vw;
  background-color: ${(props) => props.theme.body};
  position: relative;
`;
const Title = styled.h1``;

const Roadmap = () => {
  return (
    <Section>
      <Title></Title>
    </Section>
  );
};

export default Roadmap;
